bool sortbysecond(tuple<int, int, int>& a, tuple<int, int, int>& b) {
    return get<1>(a) < get<1>(b);
}
 
int binSearch(int start, int end, int number, vector<tuple<int, int, int>>& vect) {
 
    while (start != end) {
        int mid = (start + end + 1) / 2;
 
        if ((get<1>(vect[mid])) <= number) {
            start = mid;
        }
        else {
            end = mid - 1;
        }
    }
 
    return start;
 
}
 
 
